import styled from "styled-components";

export const Main = styled.main`
    max-width:480px;
    height:95vh;
    border: 1px solid #000;
    margin: 0 auto;
    margin-top: 5rem;

    h1 {
        text-align: center;
        font-size:5rem;
    }
`

export const StationList = styled.div`
    background-color:gold;
    width:100%;
    height:auto;
    display:flex;
    flex-flow: row wrap;

    button {
        width:50%;
        height:30%;
    }
`
